import Card from './Card.jsx';
import Navbar from './Navbar.jsx'
import { booksByCategory, fetchFictionBooks } from './api';

await fetchFictionBooks(10)

async function App() {
  return (
    <div className="App">
      <Navbar />
      {await fetchFictionBooks(10).then(booksByCategory.fiction.array.forEach(obj => {
        <Card book={obj} />
      }))}
      <Card book={myObj}/>
    </div>
  );
}

export default App;
